import React, { useState } from "react";
import "./Navbar.css"; // Create a CSS file for styling

const Navbar = () => {
  const [showSubnav, setShowSubnav] = useState({
    about: false,
    services: false,
    partners: false,
  });

  const toggleSubnav = (menu) => {
    setShowSubnav((prevState) => ({
      ...prevState,
      [menu]: !prevState[menu],
    }));
  };

  return (
    <div className="navbar">
      <a href="#home">Home</a>
      <div className="subnav">
        <button className="subnavbtn" onClick={() => toggleSubnav("about")}>
          About <i className="fa fa-caret-down"></i>
        </button>
        <div className={`subnav-content ${showSubnav.about ? "show" : ""}`}>
          <a href="#company">Company</a>
          <a href="#team">Team</a>
          <a href="#careers">Careers</a>
        </div>
      </div>
      <div className="subnav">
        <button className="subnavbtn" onClick={() => toggleSubnav("services")}>
          Services <i className="fa fa-caret-down"></i>
        </button>
        <div className={`subnav-content ${showSubnav.services ? "show" : ""}`}>
          <a href="#bring">Bring</a>
          <a href="#deliver">Deliver</a>
          <a href="#package">Package</a>
          <a href="#express">Express</a>
        </div>
      </div>
      <div className="subnav">
        <button className="subnavbtn" onClick={() => toggleSubnav("partners")}>
          Partners <i className="fa fa-caret-down"></i>
        </button>
        <div className={`subnav-content ${showSubnav.partners ? "show" : ""}`}>
          <a href="#link1">Link 1</a>
          <a href="#link2">Link 2</a>
          <a href="#link3">Link 3</a>
          <a href="#link4">Link 4</a>
        </div>
      </div>
      <a href="#contact">Contact</a>
    </div>
  );
};

export default Navbar;
